import * as React from 'react';
import logo from './e60c1b 1.png';
import cardImg from './1.png';
import SearchIcon from '@mui/icons-material/Search';
import Button from '@mui/material/Button';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import Avatar from '@mui/material/Avatar';
import Input from '@mui/material/Input';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
function App(){
  const imgStyle ={
    left: "17.36%",
    right: "74.02%",
    top: "34.88%",
    bottom: "34.88%"
  }

  return (
    <>
    <div>
    <img src={logo} alt="logo" style={imgStyle}/>
    <SearchIcon/>
    <Button variant="text" size="small" endIcon={<KeyboardArrowDownIcon/>}>Explore</Button>
    <Avatar>A</Avatar>
    <br>
    </br>
    <SearchIcon/>
    <Input defaultValue="Search by title or author" />
    <br></br><br></br>
    <Card sx={{ maxWidth: 294 }}>
      <CardMedia
        component="img"
        height="292"
        image={cardImg}
        alt="book"
      />
      <CardContent>
        <Typography gutterBottom variant="h6" component="div">
          Bring Your Human to Work
        </Typography>
        <Typography variant="body2" color="text.secondary">
        Erica Keswin 
        </Typography >
        <Typography variant="body2" startIcon={<AccessTimeIcon />} color="text.secondary">
        13 min read
        </Typography>
      </CardContent>
    </Card>

    </div>
    </>
  );
}
export default App;
